import React from 'react';
import { FaShoppingCart, FaSearch } from 'react-icons/fa';

const Home = () => {
  return (
    <div className="relative">
      {/* Background image */}
      <div className="absolute inset-0 bg-cover bg-center bg-[url('https://example.com/pizza-bg.jpg')]"></div>

      {/* Overlay */}
      <div className="absolute inset-0 bg-black bg-opacity-50"></div>

      {/* Navbar */}
      <nav className="relative z-10 flex items-center justify-between px-8 py-6">
        <div className="text-white font-bold text-2xl">PizzaStore</div>
        <ul className="flex space-x-8 text-white font-medium">
          <li><a href="#home" className="hover:text-yellow-500">Home</a></li>
          <li><a href="#menu" className="hover:text-yellow-500">Menu</a></li>
          <li><a href="#shop" className="hover:text-yellow-500">Shop</a></li>
          <li><a href="#pages" className="hover:text-yellow-500">Pages</a></li>
          <li><a href="#news" className="hover:text-yellow-500">News</a></li>
          <li><a href="#contact" className="hover:text-yellow-500">Contact Us</a></li>
        </ul>
        <div className="flex items-center space-x-6">
          <button className="bg-yellow-500 text-white px-4 py-2 rounded-md font-semibold hover:bg-yellow-600">
            Book a Table
          </button>
         
        </div>
      </nav>

      {/* Main content */}
      <div className="relative z-10 flex items-center justify-center h-screen text-center">
        <div className="text-white max-w-xl">
          <h1 className="text-4xl font-bold mb-4">GET BEST QUALITY FOOD FROM US</h1>
          <button className="bg-yellow-500 text-white px-6 py-3 rounded-md font-semibold hover:bg-yellow-600">
            EXPLORE MENU
          </button>
        </div>
      </div>
    </div>
  );
};

export default Home;
